text:
@Tesco My lunch break is not long enough to peel and check the lot, nor should it have to be.

I've reported or handed in expired food there multiple times, around 12.30-1pm

Unfortunately there aren't a lot of places to grab lunch around here - and a branch of Tesco *ought* to be safe!

@Tesco hi!
I was just in your Cowley Road petrol station branch, and found expired ham *with the date obscured* by sticking the reduced price label over the date area on front of back, rather than over the barcode area on the reverse.

I reported it to the staff there after
